    false,nt"url": null,nt"notes": "The Decade of North American Geology (DNAG)
    gravity grid values, spaced at 6 km, were used to produce the Gravity Anomaly Map
    of North America (1987; scale 1:5,000,000). Considerable caution should be exercised
    when using these gridded data in regions of sparse coverage (for example, deep oceanic
    areas). The spatial distribution of the original data from which the grid was generated
    is shown on sheet 5 of the published map. Note: There are no gridded data values
    for Mexico.",nt"license_title": null,nt"extras": [{ntt"key": "responsible-party",ntt"value":
